n `node-uuid` as \"node-uuid\",\n name as \"name\",\n coalesce(path,\'Unknown\') as \"path\",\n type as node_type,\n upper(creator) as user_creator,\n date(created) as creation_date_id,\n (extract(hour from created) * 60) + extract(minute from created) as creation_minute_id,\n upper(modifier) as user_last_modifier,\n date(modified) as last_modification_date_id,\n (extract(hour from modified) * 60) + extract(minute from modified) as last_modification_minute_id\nfrom\n stg_rest_folders\nwhere\n alfresco_id = ${alfresco_id}\n and created is not null'),(17199,57,929,0,'limit',0,'0'),(17200,57,929,0,'lookup',0,NULL),(17201,57,929,0,'execute_each_row',0,'N'),(17202,57,929,0,'variables_active',0,'Y'),(17203,57,929,0,'lazy_conversion_active',0,'N'),(17204,57,929,0,'cluster_schema',0,NULL),(17205,57,929,0,'row_distribution_code',0,NULL),(17206,57,930,0,'PARTITIONING_SCHEMA',0,NULL),(17207,57,930,0,'PARTITIONING_METHOD',0,'none'),(17208,57,930,0,'id_connection',1,NULL),(17209,57,930,0,'cache',0,'Y'),(17210,57,930,0,'cache_load_all',0,'N'),(17211,57,930,0,'cache_size',500,NULL),(17212,57,930,0,'lookup_schema',0,NULL),(17213,57,930,0,'lookup_table',0,'dm_dim_node_types'),(17214,57,930,0,'lookup_orderby',0,NULL),(17215,57,930,0,'fail_on_multiple',0,'N'),(17216,57,930,0,'eat_row_on_failure',0,'N'),(17217,57,930,0,'lookup_key_name',0,'alfresco_id'),(17218,57,930,0,'lookup_key_field',0,'alfresco_id'),(17219,57,930,0,'lookup_key_condition',0,'='),(17220,57,930,0,'lookup_key_name2',0,NULL),(17221,57,930,1,'lookup_key_name',0,'node_type'),(17222,57,930,1,'lookup_key_field',0,'src_id'),(17223,57,930,1,'lookup_key_condition',0,'='),(17224,57,930,1,'lookup_key_name2',0,NULL),(17225,57,930,0,'return_value_name',0,'id'),(17226,57,930,0,'return_value_rename',0,'node_type_id'),(17227,57,930,0,'return_value_default',0,NULL),(17228,57,930,0,'return_value_type',0,'Integer'),(17229,57,930,0,'cluster_schema',0,NULL),(17230,57,930,0,'row_distribution_code',0,NULL),(17231,54,931,0,'PARTITIONING_SCH