ype,\n \'UNKNOWN\' as user_creator,\n date(\'2000-01-01\') as creation_date_id,\n -1 as creation_minute_id,\n \'UNKNOWN\'as user_last_modifier,\n date(\'2000-01-01\') as last_modification_date_id,\n -1 as last_modification_minute_id,\n 0 as size,\n -1 as parent_id\nunion all\nselect\n stg_rest_documents.alfresco_id as alfresco_id,\n stg_rest_documents.`node-dbid` as src_id,\n stg_rest_documents.`store-protocol` as \"store-protocol\",\n stg_rest_documents.`store-identifier` as \"store-identifier\",\n stg_rest_documents.`node-uuid` as \"node-uuid\",\n name as \"name\",\n coalesce(path,\'Unknown\') as path,\n type as node_type,\n coalesce(upper(mimetype),\'UNKNOWN\') as mime_type,\n coalesce(upper(creator),\'UNKNOWN\') as user_creator,\n date(created) as creation_date_id,\n (extract(hour from created) * 60) + extract(minute from created) as creation_minute_id,\n upper(modifier)as user_last_modifier,\n date(modified) as last_modification_date_id,\n (extract(hour from modified) * 60) + extract(minute from modified) as last_modification_minute_id,\n size as size,\n -1 as parent_id\nfrom\n stg_rest_documents\nwhere\n stg_rest_documents.alfresco_id = ${alfresco_id}\n and stg_rest_documents.created is not null\n'),(21326,7,1121,0,'limit',0,'0'),(21327,7,1121,0,'lookup',0,NULL),(21328,7,1121,0,'execute_each_row',0,'N'),(21329,7,1121,0,'variables_active',0,'Y'),(21330,7,1121,0,'lazy_conversion_active',0,'N'),(21331,7,1121,0,'cluster_schema',0,NULL),(21332,7,1121,0,'row_distribution_code',0,NULL),(21333,59,1122,0,'PARTITIONING_SCHEMA',0,NULL),(21334,59,1122,0,'PARTITIONING_METHOD',0,'none'),(21335,59,1122,0,'id_connection',1,NULL),(21336,59,1122,0,'commit',1,NULL),(21337,59,1122,0,'sql_field',0,'query'),(21338,59,1122,0,'insert_field',0,NULL),(21339,59,1122,0,'update_field',0,NULL),(21340,59,1122,0,'delete_field',0,NULL),(21341,59,1122,0,'read_field',0,NULL),(21342,59,1122,0,'sqlFromfile',0,'N'),(21343,59,1122,0,'sendOneStatement',0,'N'),(21344,59,1122,0,'cluster_schema',0,NULL