Table name defintion.\n    var tableName = \"ope_rest_\" + class_type + \"_\" + class.name.replace(\":\", \"_\").trim();\n    if (tableName.length > parseInt(getVariable(\"table_name_max_length\",\"\"))) {\n      var id = getClassId(class.name);\n      var postfix = \"_\" + id.trim();\n      tableName = tableName.substr(0, parseInt(getVariable(\"table_tame_max_length\",\"\")) - postfix.length);\n      tableName += postfix;\n    }\n\n    // Insert table command.\n    var query = \"\";\n    query += \"INSERT INTO `\" + tableName + \"` (\";\n\n    // Common fields.\n    query += \"`alfresco_id`,\";\n    if (class_type.equals(\'documents\') || class_type.equals(\'aspects\')) {\n      query += \"`document_node-dbid`,\";\n    }\n    if (class_type.equals(\'folders\') || class_type.equals(\'aspects\')) {\n      query += \"`folder_node-dbid`,\";\n    }\n    \n    // Custom fields.\n    for (var  j = 0; j < class.properties.length; ++j) {\n      for (property in class.properties[j]) {\n        query += \"`\" + property.replace(\":\", \"_\").trim() + \"`,\";\n      }\n    }\n    query = query.substring(0, query.length - 1); \n\n    query += \") VALUES (\";\n\n    // Common fields.\n    query += alfresco_id + \",\";\n    if (class_type.equals(\'documents\') || class_type.equals(\'aspects\')) {\n      query += document_node_dbid + \",\";\n    }\n    if (class_type.equals(\'folders\') || class_type.equals(\'aspects\')) {\n      query += folder_node_dbid + \",\";\n    }\n\n    // Custom fields.\n    for (var  j = 0; j < class.properties.length; ++j) {\n\n      for (property in class.properties[j]) {\n\n        var propertyType = getPropertyType(classInfo, property);\n\n        switch(propertyType) {\n\n          case \"d:boolean\":  query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : class.properties[j][property].trim(); break;\n          case \"d:date\":     query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : \"to_date(\'\" + class.properties[j][property].trim() + \"\', \'yyyy-MM-dd\')\"; break;\n          case \"d:datetime\": query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : \"to_timestamp(\'\" + class.properties[j][property].trim() + \"\', \'yyyy-MM-ddTHH:mi:ss.SSS\')\"; break;\n          case \"d:double\":   query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : class.properties[j][property].trim(); break;\n          case \"d:float\":    query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : class.properties[j][property].trim(); break;\n          case \"d:int\":      query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : class.properties[j][property].trim(); break;\n          case \"d:long\":     query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : class.properties[j][property].trim(); break;\n          case \"d:text\":     query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : \"\'\" + class.properties[j][property].replace(/\'/g, \"\'\'\") + \"\'\"; break;\n          default:           query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : \"\'\" + class.properties[j][property].replace(/\'/g, \"\'\'\") + \"\'\"; break;\n        }\n\n        query += \",\";\n      }\n\n    }\n    query = query.substring(0, query.length - 1); \n\n    query += \"); \";\n  }\n\n  return query;\n}\n\nfunction getClassInfo(className) {\n\n  var metadataInfo = JSON.parse(getVariable(\"custom_metadata_info\",\"\"));\n\n  if (class_type.equals(\"aspects\")) {\n\n    for (var  i = 0; i < metadataInfo.aspects.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.aspects[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.aspects[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n  else {\n\n    for (var  i = 0; i < metadataInfo.types.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.types[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.types[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n\n  throw \"Class info not defined for \'\" + className + \"\'.\";\n}\n\nfunction getClassId(className) {\n\n  var metadataInfo = JSON.parse(getVariable(\"custom_classes_ids\",\"\"));\n\n  if (class_type.equals(\"aspects\")) {\n\n    for (var  i = 0; i < metadataInfo.aspects.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.aspects[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.aspects[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n  else {\n\n    for (var  i = 0; i < metadataInfo.types.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.types[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.types[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n\n  throw \"Class id not defined for \'\" + className + \"\'.\";\n}\n\nfunction getPropertyType(classInfo, propertyName) {\n\n  for (var  i = 0; i < classInfo.length; ++i) {\n    for (metadataInfoPropertyName in classInfo[i]) {\n      if (propertyName.equals(metadataInfoPropertyName)) {\n        return classInfo[i][metadataInfoPropertyName];\n      }\n    }\n  }\n\n  throw \"Property info not defined for \'\" + propertyName + \"\' into the class \'\" + className + \"\'.\";\n}\n'),(23646,53,1208,0,'jsScript_type',0,NULL),(23647,53,1208,0,'field_name',0,'query'),(23648,53,1208,0,'field_rename',0,'query'),(23649,53,1208,0,'field_type',0,'String'),(23650,53,1208,0,'field_length',-1,NULL),(23651,53,1208,0,'field_precision',-1,NULL),(23652,53,1208,0,'field_replace',0,'N'),(23653,53,1208,0,'cluster_schema',0,NULL),(23654,53,1208,0,'row_distribution_code',0,NULL),(23655,53,1209,0,'PARTITIONING_SCHEMA',0,NULL),(23656,53,1209,0,'PARTITIONING_METHOD',0,'none'),(23657,53,1209,0,'loglevel',0,'log_level_basic'),(23658,53,1209,0,'displayHeader',0,'Y'),(23