xtract(minute from stg_workflow_instances.duedate),-1) as due_minute_id,\n coalesce(date(stg_workflow_instances.enddate), str_to_date(\'2000-01-01\',\'%Y-%m-%d\')) as end_date_id,\n coalesce((extract(hour from stg_workflow_instances.enddate) * 60) + extract(minute from stg_workflow_instances.enddate),-1) as end_minute_id,\n round(coalesce(timediff(str_to_date(stg_workflow_instances.enddate,\'%Y-%m-%dT%H:%i:%s\'),str_to_date(stg_workflow_instances.startdate,\'%Y-%m-%dT%H:%i:%s\'))/60,0)) as duration,\n round(coalesce(timediff(str_to_date(stg_workflow_instances.duedate,\'%Y-%m-%dT%H:%i:%s\'),str_to_date(stg_workflow_instances.startdate,\'%Y-%m-%dT%H:%i:%s\'))/60,0)) as max_duration,\n case when stg_workflow_instances.enddate is null then concat(dm_dim_alfresco.url,\'/alfresco/service/api/workflow-instances/\',stg_workflow_instances.id,\'/diagram\') else \'Unknown\' end as diagram_url,\n coalesce(dm_dim_workflow_definitions.id, (select w2.id from dm_dim_workflow_definitions w2 where w2.alfresco_id = ${alfresco_id} and w2.url = \'Unknown\')) as definition_id\nfrom\n stg_workflow_instances\n join dm_dim_alfresco on stg_workflow_instances.alfresco_id = dm_dim_alfresco.id\n left join dm_dim_users on dm_dim_users.alfresco_id = dm_dim_alfresco.id and dm_dim_users.src_user = upper(stg_workflow_instances.initiator)\n left join dm_dim_workflow_definitions on dm_dim_workflow_definitions.alfresco_id = dm_dim_alfresco.id and dm_dim_workflow_definitions.url = stg_workflow_instances.definitionurl\nwhere\n stg_workflow_instances.alfresco_id = ${alfresco_id}\n\n'),(25714,41,1308,0,'limit',0,'0'),(25715,41,1308,0,'lookup',0,NULL),(25716,41,1308,0,'execute_each_row',0,'N'),(25717,41,1308,0,'variables_active',0,'Y'),(25718,41,1308,0,'lazy_conversion_active',0,'N'),(25719,41,1308,0,'cluster_schema',0,NULL),(25720,41,1308,0,'row_distribution_code',0,NULL),(25721,41,1309,0,'PARTITIONING_SCHEMA',0,NULL),(25722,41,1309,0,'PARTITIONING_METHOD',0,'none'),(25723,41,1309,0,'id_connection',1,NULL)